import React from 'react';
import { Link } from 'react-router-dom';
import Preloader from './Preloader';
import img1 from "../assets/img/logo.png";
import '../assets/css/welcomePage.css'; // Import CSS file for styling

const WelcomePage = () => {
    return (
        <div className="welcome-container">
            <div class="outer-circle">
                <div class="wrapper">
                    <div class="breath">
                        <div class="flare1"></div>
                        <div class="flare2"></div>
                    </div>
                </div>
            </div>
            <Preloader />
            <div className="content-container">
                <h1 className="title">CARE CUBE</h1>
                <p className="subtitle">Empower yourself to live a happier and stress-free life with our counseling app. Gain valuable insights and guidance for a more fulfilling life journey.</p>
                <img src={img1} alt="CARE CUBE Logo" className="logo-image" />
                <Link to="/lor" className="get-started-link">
                    <button className="get-started-button">Get Started</button>
                </Link>
            </div>
        </div>
    );
}

export default WelcomePage;
